class Data {
  Data({
      String? matchid, 
      List<Lineups>? lineups,}){
    _matchid = matchid;
    _lineups = lineups;
}

  Data.fromJson(dynamic json) {
    _matchid = json['MATCH_ID'];
    if (json['LINEUPS'] != null) {
      _lineups = [];
      json['LINEUPS'].forEach((v) {
        _lineups?.add(Lineups.fromJson(v));
      });
    }
  }
  String? _matchid;
  List<Lineups>? _lineups;

  String? get matchid => _matchid;
  List<Lineups>? get lineups => _lineups;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['MATCH_ID'] = _matchid;
    if (_lineups != null) {
      map['LINEUPS'] = _lineups?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

