class Lineups {
  Lineups({
      num? teamnumber, 
      List<Players>? players, 
      List<InjuredSuspended>? injuredsuspended, 
      List<num>? standingformations,}){
    _teamnumber = teamnumber;
    _players = players;
    _injuredsuspended = injuredsuspended;
    _standingformations = standingformations;
}

  Lineups.fromJson(dynamic json) {
    _teamnumber = json['TEAM_NUMBER'];
    if (json['PLAYERS'] != null) {
      _players = [];
      json['PLAYERS'].forEach((v) {
        _players?.add(Players.fromJson(v));
      });
    }
    if (json['INJURED_SUSPENDED'] != null) {
      _injuredsuspended = [];
      json['INJURED_SUSPENDED'].forEach((v) {
        _injuredsuspended?.add(InjuredSuspended.fromJson(v));
      });
    }
    _standingformations = json['STANDING_FORMATIONS'] != null ? json['STANDING_FORMATIONS'].cast<num>() : [];
  }
  num? _teamnumber;
  List<Players>? _players;
  List<InjuredSuspended>? _injuredsuspended;
  List<num>? _standingformations;

  num? get teamnumber => _teamnumber;
  List<Players>? get players => _players;
  List<InjuredSuspended>? get injuredsuspended => _injuredsuspended;
  List<num>? get standingformations => _standingformations;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['TEAM_NUMBER'] = _teamnumber;
    if (_players != null) {
      map['PLAYERS'] = _players?.map((v) => v.toJson()).toList();
    }
    if (_injuredsuspended != null) {
      map['INJURED_SUSPENDED'] = _injuredsuspended?.map((v) => v.toJson()).toList();
    }
    map['STANDING_FORMATIONS'] = _standingformations;
    return map;
  }

}

